import React from "react";
import { signOut } from "firebase/auth";
import { auth } from "../firebase-config";

export default function PeamineLeht() {
  const logiValja = () => {
    signOut(auth).catch((err) => {
      alert.err;
    });
  };
  return (
    <div>
      <h1>peamine</h1>
      <button onClick={logiValja}>Logi valja </button>
    </div>
  );
}
